static void
_shn_interface_on_signal_message (
    ShnInterface *object,
    gint arg_from,
    gint arg_type,
    gint arg_wpram,
    GVariant *arg_lpram)
{
  ShnInterfaceSkeleton *skeleton = SHN_INTERFACE_SKELETON (object);

  GList      *connections, *l;
  GVariant   *signal_variant;
  connections = g_dbus_interface_skeleton_get_connections (G_DBUS_INTERFACE_SKELETON (skeleton));

  signal_variant = g_variant_ref_sink (g_variant_new ("(iii@a{sv})",
                   arg_from,
                   arg_type,
                   arg_wpram,
                   arg_lpram));
  for (l = connections; l != NULL; l = l->next)
    {
      GDBusConnection *connection = l->data;
      g_dbus_connection_emit_signal (connection,
        NULL, g_dbus_interface_skeleton_get_object_path (G_DBUS_INTERFACE_SKELETON (skeleton)), "local.shell.IpcInterface", "message",
        signal_variant, NULL);
    }
  g_variant_unref (signal_variant);
  g_list_free_full (connections, g_object_unref);
}

